import './App.css';
import styled from 'styled-components';
import {Container } from '../src/globalStyles';

const Nav=styled.nav`
background-color:#101522;
height:80px;
display:flex;
align-items:center;
justify-content:center;
font-size:2rem;
position:sticky;
top:0;
z-index:999;
` 
const NavbarContainer=styled(Container)`
height:80px;
display:flex;
align-items:center;
justify-content:space-between;
`

function App() {
  return (
   <>
  <Nav>
    <NavbarContainer>
      MESH
      </NavbarContainer>
  </Nav>
   </>
  );
}

export default App;
